items.description:
Renault Sandero Stepway 2017 г ; 1.6 Акпп в Превосходном состоянии. Надежная, Качественная, Красивая! Высокий клиренс! 
Птс оригинал, 1 собственник ( 2 записи);
Пробег 37379 км — Реальный ( готов к любым проверкам и диагностикам);
Готов проехать к официальному дилеру и подтвердить ;
Было одно Дтп небольшое: была легкая притертость правых дверей, отремонтировано специализированном сервисом ( косметический окрас двери, именно косметический) ; весь остальной кузов в Заводском окрасе ; Остекление все Заводское ;
Комплектация Богатая: климат — контроль ; круиз- контроль ; подогревы сидений и зеркал ; Bluetooth, Навигация ; задний парктроник ; Usb, Aux и тд ;
Сигнализация с автозапуском Starline ;
Комплект зимней и летней резины дисках ;
Полностью Обслуженный и не требует вложений ;
Реальный «живой» автомобиль;
Готов к любым проверкам и проехать в любой специализированный сервис ;
Автосалоны не звоните.
Торг возможен, небольшой.

